.section1 {
  height: 100px;
  position: relative;
  top: 50px;
  z-index: 1000;
  background-color: white;
  border-bottom: 2px solid #6192d38f;
  border-radius: 0px 0px 40% 40%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  .title {
    margin-top: 0rem;
    font-size: 48px;
    font-weight: 600;
    color: #3966a2;
  }
}
.section2 {
  height: 100px;
  position: relative;
  top: -50px;
  z-index: 1000;
  background-color: #ffffff;
  border-top: 2px solid #6192d38f;
  border-radius: 40% 40% 0px 0px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  .title {
    margin-top: 0rem;
    font-size: 48px;
    font-weight: 600;
    color: #3966a2;
  }
}
.swiper-boxs {
  position: relative;
  z-index: 10;
  .box {
    height: 400px;
    img {
      width: 100%;
      height: 100%;
    }
  }
}
.section3 {
  position: relative;
  padding-top: 60px;
  min-height: 600px;
  z-index: 1000;
  background-image: url("@/assets/img/背景@1x.png");
  background-size: cover;
  .content_left {
    border-radius: 20px;
    min-height: 500px;
    background-color: #6192d38f;
    transform: rotate(-10deg);
  }
  .content_right {
    border-radius: 20px;
    min-height: 400px;
  }
}
.skill-circle {
  .title-main {
    display: flex;
    justify-content: center;
    font-size: 40px;
    font-weight: 700;
    color: #3966a2;
    padding: 1rem 0rem;
  }
  .skill-circle-box {
    box-shadow: rgba(0, 0, 0, 0.24) 0px 3px 8px;
    border-radius: 8px;
    padding: 1rem;
    margin-bottom: 1rem;
    display: flex;
    .rate {
      width: 30%;
      /* border: 1px solid red; */
      display: flex;
      justify-content: center;
      align-items: center;
    }
    .content {
      width: 70%;
      /* border: 1px solid blue; */
      font-size: 16px;
      .title {
        font-size: 20px;
        font-weight: 500;
        margin-bottom: 4px;
      }
    }
  }
}
.experience {
  .title {
    display: flex;
    justify-content: center;
    font-weight: 700;
  }
  .company {
    display: flex;
    text-align: center;
    justify-content: center;
    margin: 1rem 0rem;
    font-weight: bold;
  }
}
.project {
  .title {
    display: flex;
    justify-content: center;
    font-weight: 700;
  }
  .box {
    position: relative;
    padding: 1rem;
    border-radius: 8px;
    background-color: #6192d38f;
    cursor: pointer;
    color: white;
    text-align: center;
    .fancy-text {
      font-weight: bold;
      background: linear-gradient(90deg, #ffffff, #00c8ff);
      background-size: 200% auto;
      background-clip: text;
      -webkit-background-clip: text;
      color: transparent;
      transition: background-position 1s ease;
    }
    img {
      position: absolute;
      height: 50px;
      left: -20px;
      top: -30px;
      transform: rotate(-10deg);
    }
  }
  .box-wrapper {
    /* display: inline-block; */
    &:hover {
      border-radius: 9px;
      background: linear-gradient(to bottom right, #6192d38f, rgb(0, 157, 255));
      /* box-shadow: 0px 0px 10px 0px rgba(255, 158, 69, 0.5); */
    }
  }
}
.home-bottom {
  width: 100%;
  background-image: url("@/assets/img/home-banner.png");
  background-size: contain;
  padding: 4rem;
  display: flex;
  align-items: center;
  min-height: 300px;
  img {
    width: 100%;
    height: 300px;
  }
  .content {
    padding: 1rem 1rem;
    width: 100%;
    display: flex;
    justify-content: space-between;
    button {
      background-color: rgba(97, 146, 211, 1);
      padding: 16px;
      border-radius: 6px;
      color: white;
    }
  }
}
.popupBg {
  background-color: rgba(0, 0, 0, 0.5) !important;
}
@media (max-width: 500px) {
  .home-bottom {
    .content {
      flex-direction: column;
    }
  }
}
.dialogContact {
  padding: 1rem;
}

